Fl_Double_Window* BuddyWindow::make_window() {
  Fl_Double_Window* w;
  { Fl_Double_Window* o = buddyWindow = new Fl_Double_Window(255, 430, "DirectNet");
    w = o;
    o->color(FL_FOREGROUND_COLOR);
    o->callback((Fl_Callback*)mainWinClosed, (void*)(this));
    { Fl_Browser* o = onlineList = new Fl_Browser(0, 50, 255, 180);
      o->type(2);
      o->image(image_dn);
      o->labelcolor(FL_BACKGROUND2_COLOR);
      o->callback((Fl_Callback*)flSelectBuddy);
      o->align(FL_ALIGN_TOP_LEFT);
      o->when(3);
      Fl_Group::current()->resizable(o);
    }
    { Fl_Button* o = chatButton = new Fl_Button(0, 235, 255, 25, "Chat");
      o->callback((Fl_Callback*)talkTo);
    }
    { Fl_Input* o = connectInput = new Fl_Input(0, 285, 255, 25, "  Connect to (IP or hostname):");
      o->labelcolor(FL_BACKGROUND2_COLOR);
      o->callback((Fl_Callback*)estConn);
      o->align(FL_ALIGN_TOP_LEFT);
      o->when(FL_WHEN_ENTER_KEY);
    }
    { Fl_Input* o = findUser = new Fl_Input(0, 330, 255, 25, "  Find (username):");
      o->labelcolor(FL_BACKGROUND2_COLOR);
      o->callback((Fl_Callback*)estFnd);
      o->align(FL_ALIGN_TOP_LEFT);
      o->when(FL_WHEN_ENTER_KEY);
    }
    { Fl_Input* o = chatJoin = new Fl_Input(0, 375, 255, 25, "  Join or create chat:");
      o->labelcolor(FL_BACKGROUND2_COLOR);
      o->callback((Fl_Callback*)estCht);
      o->align(FL_ALIGN_TOP_LEFT);
      o->when(FL_WHEN_ENTER_KEY);
    }
    { Fl_Button* o = bSetAway = new Fl_Button(0, 405, 125, 25, "Away");
      o->callback((Fl_Callback*)fSetAway);
    }
    { Fl_Button* o = bBack = new Fl_Button(130, 405, 125, 25, "Back");
      o->callback((Fl_Callback*)fBack);
    }
    o->end();
  }
  return w;
}
